import { useState } from "react";
import close from '../Assets/close.png';

function App() {
    return (
        <div className="w-[100vw] h-[100vh] loginpage flex justify-center flex-col items-center">
            <div className="w-full h-full">
                
            </div>
                <div className="w-full h-[5vh] bordertest flex justify-end items-center">
                    <div className="w-[3vw] h-full flex justify-center items-center">
                        <img src={close}></img>
                    </div>
                </div>
                <div className="w-full h-[98vh] bordertest flex justify-center items-center">
                    <div className="w-[30vw] h-[65vh] bordertest logincontainer"></div>
                </div>
        </div>
    );
  }
  
export default App;
